named_argument!(EchoText, "text", String); async fn echo_command(ctx: Context, Arg(text): Arg<EchoText>) -> Result<(), BotError> { ctx.interaction.reply(ctx, text).await?; Ok(())
} fn example() { Client::builder() .command( CommandBuilder::new() .name("echo") .option( OptionBuilder::new() .name("text") .kind(OptionKind::String) ) // --- .require(RequireGuild() && RequireCustom(123)) // equivalent to .require(ConcurrentAnd(RequireGuild(), RequireCustom(123))) // --- .callback(echo_command) );
}

