There are two traits that the storage system uses. The storage backend must implement the StorageBackend trait. A storage key must implement the StorageKey trait. trait StorageKey { const ID: &'static str; type Value: DeserializeOwned + Serialize + Send; fn get_key(self) -> String;
} trait StorageBackend: Sized { type Error: std::error::Error; async fn register<K: StorageKey + Send>(&self) -> Result<(), Self::Error>; async fn get<K: StorageKey + Send>(&self, key: K) -> Result<Option<K::Value>, Self::Error>; // return previous value, if any async fn set<K: StorageKey + Send>(&self, key: K, value: K::Value) -> Result<Option<K::Value>, Self::Error>;
}
